    '#cookie_title' => 'Cookie Policy',
    '#cookie_par_title1' => 'Cosa sono i cookie?',
    '#cookie_definizione' => "I cookie sono piccoli file di testo che vengono inviati dal sito web visitato dall’utente sul dispositivo dell'utente (solitamente al browser), dove vengono memorizzati in modo da poter riconoscere tale dispositivo alla successiva visita. Ad ogni visita successiva, infatti, i cookies sono reinviati dal dispositivo dell’utente al sito.<br/> I cookies possono essere installati, però, non solo dallo stesso gestore del sito visitato dall’utente (cookies di prima parte), ma anche da un sito diverso che installa cookies per il tramite del primo sito (cookies di terze parti) ed è in grado di riconoscerli. Questo accade perché sul sito visitato possono essere presenti elementi (immagini, mappe, suoni, link a pagine web di altri domini, etc.) che risiedono su server diversi da quello del sito visitato.<br/> Ai sensi di quanto indicato nel Provvedimento del Garante della Privacy del 8 Maggio 2014 “<i>Individuazione delle modalità semplificate per l’informativa e l’acquisizione del consenso per l’uso dei cookie</i>” (di seguito, “Provvedimento”), per i cookies installati da terze parti, gli obblighi di informativa e, se ne ricorrono i presupposti, di consenso gravano sulle terze parti; il titolare del sito, in qualità di intermediario tecnico fra le terze parti e gli utenti, è tenuto ad inserire nell’informativa estesa i link aggiornati alle informative e i moduli di consenso delle terze parti.<br/> <br/> In base alla finalità, i cookies si distinguono in cookies tecnici e cookies di profilazione.",
    '#cookie_tecnici' => "I cookies tecnici sono installati al solo fine di effettuare la trasmissione di una comunicazione su una rete di comunicazione elettronica, o nella misura strettamente necessaria al fornitore di un servizio della società dell'informazione esplicitamente richiesto dall'abbonato o dall'utente a erogare tale servizio(cfr. art. 122, co.1, del D. Lgs. n. 196/2003 (cd. Codice Privacy) come modificato ai sensi dell’art.11, comma 1, lett. b), D. Lgs. 10 agosto 2018, n. 101).  ",
    '#cookie_tecnici_uso' => "Sono solitamente utilizzati per consentire una navigazione efficiente tra le pagine, memorizzare le preferenze degli utenti, memorizzare informazioni su specifiche configurazioni degli utenti, effettuare l’autenticazione degli utenti, etc.    ",
    '#cookie_tecnici_tipo' => "I cookies tecnici possono essere suddivisi in cookies di navigazione, utilizzati al fine di registrare dati utili alla normale navigazione e fruizione del sito web sul computer dell'utente (permettendo, ad esempio, di ricordare la dimensione preferita della pagina in un elenco) e cookies funzionali, che consentono al sito web di ricordare le scelte effettuate dall’utente al fine di ottimizzarne le funzionalità (ad esempio, i cookies funzionali consentono al sito di ricordare le impostazioni specifiche di un utente, come la selezione del paese e, se impostato, lo stato di accesso permanente). ",
    '#cookie_tecnici_funzione' => "Alcuni di questi cookies (detti essenziali o <i>strictly necessary</i>) abilitano funzioni senza le quali non sarebbe possibile effettuare alcune operazioni.",
    '#cookie_tecnici_articolo' => "Ai sensi del citato art. 122, co. 1, Codice Privacy, l’utilizzo dei cookies tecnici non richiede il consenso degli utenti.",
    '#cookie_analytics' => "Ai cookies tecnici sono assimilati (e, pertanto, come precisato nel Provvedimento, per la relativa installazione, non è richiesto il consenso degli utenti, né gli ulteriori adempimenti normativi) i cookies cd. <i>analytics</i> se realizzati e utilizzati direttamente dal gestore del sito prima parte (dunque senza l'intervento di soggetti terzi) ai fini di ottimizzazione dello stesso per raccogliere informazioni aggregate sul numero degli utenti e su come questi visitano il sito stesso, nonché i cookie analitici realizzati e messi a disposizione da terze parti ed utilizzati dal sito prima parte per meri fini statistici, qualora vengano, fra l’altro, adottati strumenti idonei a ridurre il potere identificativo dei cookie analitici che utilizzano (ad esempio, mediante il mascheramento di porzioni significative dell'indirizzo IP).",
    '#cookie_profilazione' => "I cookies di profilazione servono a tracciare la navigazione dell’utente, analizzare il suo comportamento ai fini marketing e creare profili sui suoi gusti, abitudini, scelte, etc. in modo da trasmettere messaggi pubblicitari mirati in relazione agli interessi dell’utente ed in linea con le preferenze da questi manifestati nella navigazione online.",
    '#cookie_installazione' => "Tali cookies possono essere installati sul terminale dell’utente solo se questo abbia espresso il proprio consenso con le modalità indicate nel Provvedimento. In base alla loro durata, i cookies si distinguono in persistenti, che rimangono memorizzati, fino alla loro scadenza, sul dispositivo dell’utente, salva rimozione da parte di quest’ultimo, e di sessione, che non vengono memorizzati in modo persistente sul dispositivo dell’utente e svaniscono con la chiusura del browser.",
    '#cookie_titolo_paragrafo_cookie_usati' => "Quali cookies sono utilizzati nel portale di {appName}?",
    '#cookie_usati' => "Il presente sito fa uso esclusivo di cookies tecnici, installati dal sito stesso al fine di monitorare il funzionamento del sito e consentire una navigazione efficiente sullo stesso. Tali cookies sono strettamente necessari per il corretto funzionamento del sito o per consentire la fruizione dei contenuti e dei servizi richiesti dall’utente. Ai sensi dell’art. 122 del Codice Privacy e del provvedimento del Garante per la protezione dei dati personali relativo alla “<i>Individuazione delle modalità semplificate per l’informativa e l’acquisizione del consenso per l’uso dei cookies</i>” dell’8 maggio 2014, pubblicato sulla Gazzetta Ufficiale n. 126 del 3 giugno 2014, è possibile installare nel browser degli utenti i cookies tecnici essenziali per il corretto funzionamento di un sito web, nonché quelli <i>analytics</i> di terze parti, assimilati ai cookies tecnici laddove utilizzati direttamente dal gestore del sito per raccogliere informazioni, in forma aggregata, sul numero degli utenti e su come questi visitano il sito stesso, fermo restando l’obbligo di informativa aggiornata e resa ai sensi dell’art. 13 del Regolamento UE 2016/679 (GDPR). Il presente sito utilizza, fra i cookies di terze parti assimilabili a quelli tecnici, i cookies <i>analytics</i> di Google Analytics al fine di analizzare statisticamente gli accessi o le visite al sito stesso e consentire al titolare di migliorarne la struttura, le logiche di navigazione e i contenuti. Tali cookies, opportunamente anonimizzati (es. mascheramento indirizzo IP), consentono la raccolta di informazioni aggregate sul numero degli utenti e su come questi visitano il sito senza poter identificare il singolo utente.",
    '#cookie_terze_parti' => "Nel corso della navigazione sul presente sito possono essere installati sul terminale dell’utente cookies di terze parti. Alcune funzionalità (come la vocalizzazione dei contenuti e la visualizzazione di video), infatti, vengono realizzate avvalendosi di servizi di terze parti, che producono cookie tecnici.",
    '#cookie_terze_parti_links' => "Di seguito, si riportano, le terze parti coinvolte, il tipo di cookies e il link di collegamento alla specifica cookie policy.",
    '#cookie_social_network_titolo' => "Cookie di social network",
    '#cookie_social_network' => "- Il presente portale consente agli utenti di condividere i relativi contenuti sui social network (come Facebook, Twitter) accedendo direttamente ai siti dei suddetti social network.<br/> Eventuali cookies potrebbero pertanto essere installati su tali siti (e non sul presente portale). Regione Lombardia non è a conoscenza della finalità dei cookies eventualmente installati dai suddetti Social network sui relativi siti.<br/> Al fine di permettere agli utenti di conoscere modalità e finalità dei trattamenti delle informazioni degli utenti da parte delle terze parti, si riportano i seguenti link alle informative privacy e la cookie policy delle terze parti coinvolte:",
    '#facebook' => "Facebook",
    '#twitter' => "Twitter",
    '#non_usati_cookies' => "Non sono utilizzati sul presente sito cookies di profilazione né di prima, né di terze parti.",
    '#disabilitare_cookies_titolo' => "È possibile disabilitare i cookies?",
    '#disabilitare_cookies' => "Di default quasi tutti i browser web sono impostati per accettare automaticamente i cookies. I navigatori possono comunque modificare la configurazione predefinita tramite le impostazioni del browser utilizzato, che consentono di cancellare/rimuovere tutti o alcuni cookies o bloccare l’invio dei cookies o limitarlo a determinati siti.<br/> La disabilitazione/blocco dei cookies o la loro cancellazione potrebbe compromettere la fruizione ottimale di alcune aree del sito o impedire alcune funzionalità, nonché influire sul funzionamento dei servizi delle terze parti.<br/> La configurazione della gestione dei cookies dipende dal browser utilizzato. Si riportano di seguito i link alle guide per la gestione dei cookies dei principali browser:",
